/** @jsx jsx */

import React, { Component } from 'react';
import { css, jsx } from '@emotion/core';
import { Link } from 'react-router-dom';

import Description from '../components/Description';
import Thumbnail from '../components/Thumbnail';
import Photo from '../assets/photos/DiegoFigueroa-MK.JPG'
import Article from '../components/Article'

const content = {
  header: "Resume + Contact",
}

const resume = require('assets/files/MelissaKwanResume.pdf')

const resumeStyle = css`
    div {
        font-size: 40px;
    }
`;

export default class PageResume extends Component {
  render() {
    return (
      <Article {...content}>
        <div css={resumeStyle}>
          <div>Here's my <a target="_blank" href={resume}>resume.</a></div>
          <div>
            You can contact me by email <a target="_blank" href="mailto:mkwan@college.harvard.edu">(mkwan@college.harvard.edu)</a> or
            find me on <a target="_blank" href="https://www.linkedin.com/in/melissa-kwan-147b13143/">LinkedIn.</a>
          </div>
        </div>
      </Article>
    );
  }
}
